import { CandidateProgress } from "./components/CandidateProgress";
import styles from "./App.module.scss";

export function App() {
  return (
    <div className={styles.app}>
      <div className={styles.center}>
        <h1>Candidate Progress</h1>
        <CandidateProgress />
      </div>
    </div>
  );
}
